import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { FiLogOut, FiPlusCircle, FiSearch, FiUser, FiLayers, FiCompass } from "react-icons/fi";

function Dashboard() {
  const [user, setUser] = useState(null);
  const [skills, setSkills] = useState([]);
  const [search, setSearch] = useState("");
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) {
      navigate("/login");
    } else {
      fetchUserProfile(token);
      fetchSkills();
    }
  }, []);

  const fetchUserProfile = async (token) => {
    try {
      const response = await fetch("http://localhost:5000/api/auth/profile", {
        method: "GET",
        headers: { Authorization: `Bearer ${token}` },
      });
      const data = await response.json();
      if (response.ok) {
        setUser(data);
      } else {
        alert("Session expired! Please log in again.");
        localStorage.removeItem("token");
        navigate("/login");
      }
    } catch (error) {
      console.error("Error fetching user profile:", error);
    }
  };

  const fetchSkills = async () => {
    try {
      const response = await fetch("http://localhost:5000/api/skills");
      const data = await response.json();
      setSkills(data);
    } catch (error) {
      console.error("Error fetching skills:", error);
    }
  };

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/login");
  };

  return (
    <div className="flex h-screen bg-gray-100">
      {/* Sidebar */}
      <div className="w-64 bg-white shadow-lg p-5 flex flex-col">
        <h2 className="text-2xl font-bold text-purple-700 mb-6 flex items-center">
          <FiLayers className="mr-2" /> Dashboard
        </h2>
        <nav className="flex flex-col space-y-4">
          <button onClick={() => navigate("/profile")} className="flex items-center p-3 rounded-lg hover:bg-purple-100">
            <FiUser className="mr-3" /> Profile
          </button>
          <button
                onClick={() => navigate("/")}
                className="flex items-center p-3 rounded-lg hover:bg-gray-100 transition"
              >
                <FiHome className="mr-3" /> Home
              </button>
          <button
                    onClick={() => navigate("/transactions")}
                    className="flex items-center p-3 rounded-lg hover:bg-purple-100 transition"
                  >
                    📜 Transaction History
                  </button>
          <button onClick={handleLogout} className="flex items-center p-3 rounded-lg text-red-500 hover:bg-red-100">
            <FiLogOut className="mr-3" /> Logout
          </button>
        </nav>
      </div>

      {/* Main Content */}
      <div className="flex-1 flex flex-col p-6">
        {/* Welcome Section */}
        <h2 className="text-2xl font-semibold text-purple-700 mb-4">Welcome, {user?.name || "User"}!</h2>

        {/* Add Courses Section */}
        <div
          className="bg-white shadow-lg rounded-lg p-6 mb-6 cursor-pointer hover:shadow-xl transition duration-300"
          onClick={() => navigate("/explore")}
        >
          <div className="flex items-center space-x-4">
            <FiPlusCircle className="text-4xl text-purple-600" />
            <div>
              <h3 className="text-xl font-bold text-gray-800">Add New Courses</h3>
              <p className="text-gray-600">Click here to explore and add new courses to the platform.</p>
            </div>
          </div>
        </div>

        {/* Skills Section */}
        <div className="bg-white shadow-lg rounded-lg p-6">
          <h3 className="text-xl font-bold text-purple-700 mb-4">Your Skills</h3>
          {skills.length > 0 ? (
            <ul className="list-disc ml-6">
              {skills.map((skill) => (
                <li key={skill._id} className="text-gray-600">
                  {skill.name} ({skill.hoursAvailable} hours)
                </li>
              ))}
            </ul>
          ) : (
            <p className="text-gray-500">No skills added yet.</p>
          )}
        </div>

        {/* Search Section */}
        <div className="mt-6">
          <h3 className="text-xl font-bold text-purple-700 mb-4">Search Skills</h3>
          <input
            type="text"
            placeholder="Search skills..."
            value={search}
            onChange={(e) => setSearch(e.target.value)}
            className="border p-2 rounded-md w-full focus:ring-2 focus:ring-purple-400"
          />
          <div className="mt-4">
            {skills
              .filter((skill) => skill.name.toLowerCase().includes(search.toLowerCase()))
              .map((skill) => (
                <div key={skill._id} className="bg-gray-100 p-4 rounded-lg mb-2 shadow">
                  <h4 className="text-lg font-semibold">{skill.name}</h4>
                  <p className="text-gray-600">{skill.description}</p>
                </div>
              ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
